import "./Todo.css";

import icon_moon from "./../icon-moon.svg";
import icon_sun from "./../icon-sun.svg";
import icon_check from "./../icon-check.svg";
import icon_cross from "./../icon-cross.svg";
const TodoUi = () => {
  return (
    <div className="continer">
      <div className="continerUser">
        <div className="Themes">
          <h1>TODO</h1>
          <img src={icon_moon} alt="" />
        </div>
        <div className="UserInput">
          <input type="text" />
        </div>
        <ui className="UserResults">
          <li>
            <div className="list-check">
                <button className="Checked">
                <img src={icon_check} alt="" />
                <div className="Checked-Border"></div>
                </button>
                <p>Complete online JavaScript course</p>
            </div>
            <button className="Deleted">
              <img src={icon_cross} alt="" />
            </button>
          </li>
        </ui>
      </div>
    </div>
  );
};

export default TodoUi;
